 Story Time: I had never been overseas and I was beyond excited and a little anxious. Once I arrived to the airport to head out on my journey they told me my flight was cancelled because it was out of fuel. First off okay... put some in it?! So I was like what’s my new flight? They said tomorrow blah blah blah. All I heard was tomorrow. Tomorrow was my orientation. Tomorrow is when I am getting picked up. They said they couldn’t do anything else. So I started to panic and cry. And ohhh... magically something opened up and they put me on a new flight that day 😒 so that day I learned that there is always another way you just have to cause a little scene to get it... the flight they put me on had fewer stops and ended up working out a lot better! On my way there I was under the impression I was staying in dorms by the college -walking distance... once we got picked we were dropped off at an apartment complex that was an hour walk to school 🤦🏻‍♀️ so little midwest me had her first public transportation experience and loved it!! 

